import React from 'react';
import ReactDOM from 'react-dom';
import PrismicApp from './PrismicApp';
import * as serviceWorker from './registerServiceWorker'


ReactDOM.render(
  <PrismicApp />,
  document.getElementById('root'),
  serviceWorker.register()
);
